import React from 'react';
import Header from './components/Header';
import PersonalInfo from './components/PersonalInfo';
import Experience from './components/Experience';
import Education from './components/Education';
import Skills from './components/Skills';

function App() {
  const resumeData = {
    personalInfo: {
      name: 'สมชาย ใจดี',
      title: 'Senior Frontend Developer',
      email: 'somchai.jaidee@email.com',
      phone: '081-234-5678',
      address: '123 ถนนสุขุมวิท แขวงคลองตัน เขตวัฒนา กรุงเทพฯ 10110',
      summary: 'นักพัฒนา Frontend ที่มีประสบการณ์มากกว่า 5 ปี ในการพัฒนาเว็บแอปพลิเคชันด้วย React, Vue.js และ Angular มีความเชี่ยวชาญในการสร้าง UI/UX ที่สวยงามและใช้งานง่าย พร้อมทำงานเป็นทีมและเรียนรู้เทคโนโลยีใหม่ๆ ได้อย่างรวดเร็ว'
    },
    experience: [
      {
        id: 1,
        company: 'Tech Solutions Co., Ltd.',
        position: 'Senior Frontend Developer',
        startDate: '2021-03',
        endDate: 'ปัจจุบัน',
        description: 'พัฒนาและดูแลระบบ Frontend ของแอปพลิเคชันหลัก ใช้ React, TypeScript และ Redux ในการพัฒนา ทำงานร่วมกับทีม Backend และ UX/UI Designer ในการออกแบบและพัฒนาฟีเจอร์ใหม่'
      },
      {
        id: 2,
        company: 'Digital Agency Bangkok',
        position: 'Frontend Developer',
        startDate: '2019-06',
        endDate: '2021-02',
        description: 'พัฒนาเว็บไซต์และเว็บแอปพลิเคชันสำหรับลูกค้าต่างๆ ใช้ Vue.js, JavaScript และ CSS3 ในการพัฒนา มีประสบการณ์ในการทำงานกับ API และการจัดการ state'
      },
      {
        id: 3,
        company: 'StartupXYZ',
        position: 'Junior Frontend Developer',
        startDate: '2018-01',
        endDate: '2019-05',
        description: 'เริ่มต้นอาชีพการพัฒนาเว็บไซต์ด้วย HTML, CSS และ JavaScript พัฒนาเว็บไซต์ responsive และเรียนรู้การใช้ framework ต่างๆ'
      }
    ],
    education: [
      {
        id: 1,
        institution: 'มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี',
        degree: 'ปริญญาตรี',
        field: 'วิศวกรรมคอมพิวเตอร์',
        graduationYear: '2017'
      },
      {
        id: 2,
        institution: 'สถาบันเทคโนโลยีไทย-ญี่ปุ่น',
        degree: 'ประกาศนียบัตร',
        field: 'การพัฒนาเว็บแอปพลิเคชัน',
        graduationYear: '2018'
      }
    ],
    skills: [
      'React', 'Vue.js', 'Angular', 'TypeScript', 'JavaScript', 
      'HTML5', 'CSS3', 'SASS/SCSS', 'Node.js', 'Express.js',
      'MongoDB', 'MySQL', 'Git', 'Docker', 'AWS', 'Figma'
    ]
  };


  return (
    <div className="container">
      <div className="resume-container">
        <Header personalInfo={resumeData.personalInfo} />
        <div className="resume-content">
          <PersonalInfo personalInfo={resumeData.personalInfo} />
          <Experience experience={resumeData.experience} />
          <Education education={resumeData.education} />
          <Skills skills={resumeData.skills} />
        </div>
      </div>
    </div>
  );
}

export default App;
